import React, {Component} from 'react';
import AllProduct from "./Product/AllProduct";
import  {BrowserRouter,Switch,Route} from 'react-router-dom'
import AddProduct from "./Product/AddProduct";
import ManageProduct from "./Product/ManageProduct";
import Brand from "./brand/Brand";
import Management from "./maincontent/Management";
import ShopByBrand from "./Shop/ShopByBrand/ShopByBrand";

class App extends Component {
    render() {
        return (
            <BrowserRouter>
            <div>
                <Switch>
                    <Route path="/" exact component={AllProduct}/>
                    <Route path="/addproduct" component={ManageProduct}/>
                    <Route path="/brand" component={ShopByBrand}/>
                </Switch>
            </div>
            </BrowserRouter>
        );
    }
}

export default App;
